import React from 'react';
import {Link} from 'react-router-dom';
import {Avatar} from 'antd';
 const navLinks = [


{
	title: 'Home' , 
	path: '/'
},
{
	title: 'Blog', 
	path: '/blog'
},
{
	title: 'Contact Us', 
	path: '/contact-us'
},
{
	title: 'Login', 
	path: '/login'
}
 ];
export default function Navigation() {
return (<nav className ="site-navigation">
	<span className="menu-title">Vee's Blog</span>
	<ul>
 { 
 navLinks.map((link, index)=> {return <li key= {index}><Link to={link.path}>{link.title}</Link></li>})
}
	</ul>
	</nav>);
};
